import React, { useEffect, useRef } from 'react';
import * as d3 from 'd3';

const BubbleChart = ({ filepath, category }) => {
    const ref = useRef();

    useEffect(() => {
        if (!filepath) {
            return;
        }
        // Fetch data and draw the bubble chart here

        // Example:
        fetch(`http://localhost:3000/bubble-chart/${btoa(filepath)}/${category}`)
        .then(response => response.json())
        .then(data => {
            // Processing and drawing logic
        });

    }, [filepath, category]);

    return (
        <div ref={ref}></div>
    );
};

export default BubbleChart;
